import React from "react";
import styled from "styled-components";
import Button from "./Button";

const Container = styled.div`
  display: flex;
  flex-direction: row;
  justify-content
`;

const TodoItem = () => {
  return (
    <Container>
      TodoItem
      <Button label="삭제" />
    </Container>
  );
};

export default TodoItem;
